import * as React from "react";
import "./style-ping.css";
import * as Mui from "@material-ui/core";

export default function PingDummy({ urlData }) {
	return (
		<>
			<Mui.Box className="resultsBox">
				<Mui.Box>
					{urlData.map((elem) => (
						<Mui.List key={elem.url}>
							{" "}
							<span> {elem.count}</span>
							<span> - {elem.url}</span>
						</Mui.List>
					))}
				</Mui.Box>
			</Mui.Box>

			<Mui.TableContainer component={Mui.Paper}>
				<Mui.Table style={{ minWidth: 700 }} aria-label="customized table">
					<TableHead>
						<TableRow>
							<Mui.StyledTableCell>Top Ping Sites</Mui.StyledTableCell>
							<Mui.StyledTableCell align="right">Calories</Mui.StyledTableCell>
						</TableRow>
					</TableHead>

					<Mui.TableBody>my items</Mui.TableBody>
				</Mui.Table>
			</Mui.TableContainer>
		</>
	);
}
